import React, {Component} from "react";
import API from "../utils/API";

class Test extends Component {
    state = {
        currentSearch: "",
        searchIds: [],
        results: [],
        error: ""
    };

    componentDidMount() {
        API.getBookIds("HarryPoter")
            .then(res => this.setState(
                {
                    currentSearch: res[0].items.volumeInfo.title,
                    searchIds: res[0].items.id
                }))
            .catch(err => console.log(err))
    }

}

export default Test;
